import React from "react";
import { Route, Routes } from "react-router-dom";
import About from "./pages/About/About";  // Importujemy About

const Routing = () => {
  return (
    <Routes>
      {/* Strona główna */}
      <Route path="/" element={<About />} />
    </Routes>
  );
};

export default Routing;
